import React from "react";
import axios from 'axios';
import Cookies  from 'universal-cookie';

export default async function getData(queryTerm,num) {
    const cookies = new Cookies();
    const token = cookies.get('token')
    var query = {
      request: queryTerm,
      index: num
    }
    axios.post('http://localhost:3001/data',query)
    .then(function (response) {

    if(queryTerm == "HomePage"){
      localStorage.setItem("homepage", JSON.stringify(response.data));
    }
    else if (queryTerm == "DispayedClubMembers"){
      localStorage.setItem("image"+num, JSON.stringify(response.data));
    }
  })
}
